import styledet from "./detail.module.css";
function Detailorder(props) {
  const handleClose = () => props.setshowmod(false);

  return (
    <>
      {props.showDetail && (
        <div
          onClick={handleClose}
          className={styledet.containt}
          onClick={handleClose}
        >
          <h2>Detail Order USER</h2>
        </div>
      )}
    </>
  );
}

export default Detailorder;
